import React, { useState, useEffect } from 'react';

export function Statistics() {

    const [users, setUsers] = useState([])

    useEffect(() => {
        const today = new Date();
        const p = new Date(today.getFullYear(), today.getMonth(), 1);
        const firstDayOfMonth = new Date(today.getFullYear(), today.getMonth(), 1);
        const fechaInicio = firstDayOfMonth.toISOString().slice(0, 10);

        fetch(`http://localhost:3001/getStatistics?fechaInicio=${encodeURIComponent(fechaInicio)}&fechaFin=${encodeURIComponent(fechaFin)}`)
        .then(response => {
            if (!response.ok) {
                throw new Error(`HTTP error! Status: ${response.status}`);
            }
            return response.json();
        })
        .then(data => {
            console.log(data); // Aquí tendrás los datos de las estadísticas
        })
        .catch(error => {
            console.error('Error al obtener estadísticas:', error);
        });
        
    }, []);

    return(
        <>
             <div className="title-box-crud">
                <h2>Estadísticas</h2>
            </div>
            <div className="estatistics-box">
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de reservas hasta hoy:</h3>
                    <h1 className="txt-black">1000</h1>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de reservas de este mes:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de usuarios activos:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Asesor con más reservas:</h3>
                </div>
            </div>
        </>
    )
}
